import React, { Component } from 'react';
import DriverList from './DriverList';

class BasicInfo extends Component {
    render() {
        return (
            <div>
                <h2>Drivers</h2>
                <DriverList/>
                <h2>Teams</h2>
                <p>Teams component here</p>
            </div>
        );
    }
}

export default BasicInfo;
